import React, {component} from "react";

class Highlight extends component {
    render () {
        return (
        <div>
            <img src={require(`${this.props.image}`)}/>
            <h3>{this.props.name}</h3>
            <p>{this.props.text}</p>
        </div>
        )
    }
}

export default Highlight;
